import React from "react";
import Nav from "./components/App/Nav/Nav";
import About from "./components/App/About/About";
import Gallery from "./components/App/Gallery/Gallery";
import Footer from "./components/App/Footer/Footer";
import Calendar from "./components/App/Calendar/Calendar";
import BookingForm from "./components/App/Calendar/BookingForm/BookingForm";
import BookingSection from "./components/App/Calendar/BookingSection/BookingSection";
import "./App.css";

function App() {
  return (
    <>
    <div className="page-container">
      <Nav />
      <About />
      <Gallery />
      <section id="calendar">
        <Calendar/>
        <BookingSection/>
      </section>
      <Footer />
    </div>
    </>
  );
}

export default App;
